import React from 'react';

const Navbar = () => {
  return (
    <nav style={styles.nav}>
      <div className="container" style={styles.container}>
        <h2 style={styles.logo}>Techverge Solutions</h2>
        <ul style={styles.links}>
          {['Home', 'About Us', 'Projects', 'Services'].map((item) => (
            <li key={item}><a href={`#${item.toLowerCase().replace(' ', '')}`} style={styles.link}>{item}</a></li>
          ))}
          <li><a href="#contact" className="btn">Contact us</a></li>
        </ul>
      </div>
    </nav>
  );
};

const styles = {
  nav: { padding: '20px 0', position: 'sticky', top: 0, background: '#fff', zIndex: 100, boxShadow: '0 2px 5px rgba(0,0,0,0.05)' },
  container: { display: 'flex', justifyContent: 'space-between', alignItems: 'center' },
  logo: { fontSize: '1.5rem', margin: 0 },
  links: { display: 'flex', listStyle: 'none', gap: '30px', alignItems: 'center' },
  link: { textDecoration: 'none', color: '#2c3e50', fontWeight: '500' }
};

export default Navbar;
